import React from 'react';

const FeaturesList = () => {
  const features = [
    {
      icon: "images/quality-results.png",
      title: "Quality Results",
      description: "Our conversions and engineering solutions deliver reliable, high-performance outcomes that meet global standards and local driving conditions—ensuring clients’ vehicles run cleaner, longer, and more efficiently."
    },
    {
      icon: "images/analytics.png",
      title: "Analytics",
      description: "Aliquam a nisl pulvinar, hendrerit arcu sed, dapibus velit. Duis ac quam id sapien vestibulum fermentum ac eu eros. Aliquam erat volutpat."
    },
    {
      icon: "images/affordable-pricing.png",
      title: "Good Pricing",
      description: "Aliquam a nisl pulvinar, hendrerit arcu sed, dapibus velit. Duis ac quam id sapien vestibulum fermentum ac eu eros. Aliquam erat volutpat."
    },
    {
      icon: "images/easy-to-use.png",
      title: "Easy To Use",
      description: "Aliquam a nisl pulvinar, hendrerit arcu sed, dapibus velit. Duis ac quam id sapien vestibulum fermentum ac eu eros. Aliquam erat volutpat."
    },
    {
      icon: "images/free-support.png",
      title: "Free Support",
      description: "Aliquam a nisl pulvinar, hendrerit arcu sed, dapibus velit. Duis ac quam id sapien vestibulum fermentum ac eu eros. Aliquam erat volutpat."
    },
    {
      icon: "images/effectively-increase.png",
      title: "Effectively Increase",
      description: "Aliquam a nisl pulvinar, hendrerit arcu sed, dapibus velit. Duis ac quam id sapien vestibulum fermentum ac eu eros. Aliquam erat volutpat."
    }
  ];

  return (
    <div className="container-fluid gtco-features-list">
      <div className="container">
        <div className="row">
          {features.map((feature, index) => (
            <div key={index} className="media col-md-6 col-lg-4">
              <div className="oval mr-4">
                <img className="align-self-start" src={feature.icon} alt="" />
              </div>
              <div className="media-body">
                <h5 className="mb-0">{feature.title}</h5>
                {feature.description}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default FeaturesList;
